IF OBJECT_ID('tempdb..#POP') IS NOT NULL 
	DROP TABLE #POP
GO


SELECT DISTINCT
	PP.PrintProcessingId,
	PP.AccountNumber,
	CentralData.dbo.CreateACSKeyline(PDXX.DF_PRS_ID, 'B', 'L') AS ACSKey,
	(LTRIM(RTRIM(PDXX.DM_PRS_X)) + ' ' + LTRIM(RTRIM(PDXX.DM_PRS_LST))) AS [Name],
	PDXX.DX_STR_ADR_X AS AddressX,
	PDXX.DX_STR_ADR_X AS AddressX,
	PDXX.DM_CT AS City,
	PDXX.DC_DOM_ST AS [State],
	PDXX.DF_ZIP_CDE AS Zip,
	PDXX.dm_FGN_ST AS ForeignState,
	PDXX.DC_FGN_CNY As Country
INTO #POP
FROM 
	CLS.billing.PrintProcessing pp
	INNER JOIN CLS.billing.LineData LD
		ON LD.PrintProcessingId = PP.PrintProcessingId
	INNER JOIN CDW..PDXX_PRS_NME PDXX
		ON PDXX.DF_SPE_ACC_ID = PP.AccountNumber
	INNER JOIN CDW..PDXX_PRS_ADR PDXX
		ON PDXX.DF_PRS_ID = PDXX.DF_PRS_ID
		AND PDXX.DC_ADR = 'L'
